import { useState } from "react";
import { SearchBar } from "./SearchBar";

export function FilterableProductTable() {

    const [state, setState] = useState({ filterText: "", onlyInStock: true })

    return (
        <SearchBar filterText={state.filterText} onlyInStock={state.onlyInStock} />
    )
}
